import pymysql
from pymysql.cursors import DictCursor

def connect():
    try:
        sql = pymysql.connect(
            host="localhost",
            user="root",
            password="muffin15",
            db="tt",
            port=3306,
            charset='utf8mb4',
            autocommit = False,
            cursorclass=DictCursor
        )
        return sql
    except Exception as e:
        print('Ошибка подключения к базе')
        print(e)

def let(word):
    return [str(word.count(letter)) for letter in 'abcdefghijklmnopqrstuvwxyz']

def insert_words(wl):

    sql = connect()
    cursor = sql.cursor()

    i = 0
    for w in wl:
        q = f"insert into words values ({i}, '{w}', {','.join(let(w))});"
        i += 1
        cursor.execute(q)
    #print(q)

    sql.commit()

    sql.close()


